import React, { Component } from 'react';
import './PrevWOD.css'

class PrevWOD extends Component {
    render() {
        const { name, workout, category, score } = this.props.workout
        return (
            <>
                <div className="shade">
                    <div className="prev-blackboard">
                        <div className="prev-wod">
                        <h2 className="prev-wodtxt">"{name}"</h2>
                        <h3 className="prev-wodtxt">Category: {category}</h3>
                        {workout.split('\n').map(element => {
                        return <h4 className="prev-wodtxt">{element}</h4>
                        })}
                        <h4 className="prev-wodtxt">Score: {score}</h4>
                    </div>
                    </div>
                </div>
            </>
        );
    }
}

export default PrevWOD;
